css:
@-moz-document domain(roblox.com) {
.dark-theme .rbx-left-col, .rbx-header, .dark-theme .content {
  background-color: #000;
  color: white;
}
.dark-theme .rbx-left-col li .text-nav:active, .dark-theme .rbx-left-col li .text-nav:link, .dark-theme .rbx-left-col li .text-nav:visited {
  color: white;
}
.dark-theme #btr-blogfeed .btr-feed {
  color: white;
}
.dark-theme .text-nav, .dark-theme .text-nav:hover {
  color: white;
}
.dark-theme .rbx-header {
  background-color: #000;
}
.dark-theme .notification, .dark-theme .notification-blue, .dark-theme .notification-red {
  background-color: #F79300;
}
.dark-theme .icon-default-logo-r, .dark-theme .icon-logo-r, .dark-theme .icon-logo-r-95 {
  color: #F79300;
}
.dark-theme .rbx-upgrade-now .btn-secondary-md {
  background-color: #F79300;
  border: none;
}
.dark-theme .rbx-upgrade-now:hover .btn-secondary-md:hover {
  background-color: #D47E00;
  border: none;
}
.dark-theme .rbx-header .rbx-navbar li:hover {
  border: 0 #F79300;
  border-bottom: 2px solid #F79300;
}
.dark-theme, .section-content {
  background-color: #000;
}
.dark-theme .btn-common-play-game-lg {
  background-color: #F79300;
}
.dark-theme .btn-common-play-game-lg:hover {
  background-color: #D47E00;
}
.dark-theme .dropdown-menu {
  background-color: #000;
}
.dark-theme .popover {
  box-shadow: 0 0 8px 0 rgb(0 0 0 / 30%);
}
.dark-theme .stack .card-list .card-item {
  background-color: #000;
}
.dark-theme .rbx-tabs-horizontal .nav-tabs, .dark-theme .rbx-tab .rbx-tab-heading {
  background-color: #000;
}
.dark-theme .container-footer {
  background-color: #000;
}
}
